    secondary: {
      main: green[200] //test
    },
    background: {
      paper: '#000000'//doesn't work
    }
  },
  typography: {
    fontFamily: 'sans-serif'
  }
}) 

const App = () => {
  return (
    <ThemeProvider theme={theme}>
      <NavBar />
      <Welcome />
      <About />
      <Projects />
    </ThemeProvider>

  );
}

export default App;
